import { skyblue } from "color-name";
import React, { Component } from "react";
import { SketchPicker } from "react-color";

class ProjectItem extends Component {
  render() {
    return (
      <>
        <skyblue />
        <h1>Project Item</h1>
      </>
    );
  }
}
export default ProjectItem;
